public int[] fix45(int[] nums) {
    int[] result = new int[nums.length];
    int index = 0;
    int fiveIndex = 0;
    for (int i = 0; i < nums.length; i++) {
        if (nums[i] == 4) {
            result[index++] = 4;
            while (nums[fiveIndex] != 5 || (fiveIndex > 0 && nums[fiveIndex - 1] == 4)) {
                fiveIndex++;
            }
            result[index++] = 5;
            fiveIndex++;
        } else if (nums[i] != 5) {
            result[index++] = nums[i];
        }
    }
    while (index < nums.length) {
        while (nums[fiveIndex] != 5) {
            fiveIndex++;
        }
        result[index++] = 5;
        fiveIndex++;
    }
    return result;
}

